import React from "react";

const Contact = () => {
  return (
    <div className="container">
      <h2>Contact Me</h2>
      <blockquote>
        Please send feedback to erikfcb@gmail.com. You will usually hear back
        from me within 24 hours.{" "}
      </blockquote>
    </div>
  );
};

export default Contact;
